import axios from 'axios';
import {url} from "./https.js";

function signin(user) {
    console.log("URL: ", url + "Auth/signin");
    console.log("User: ", JSON.stringify(user));
    return axios.post(url + "Auth/signin", JSON.stringify(user));
}

export {signin};
